import React from 'react';
import './tittle.css';

const Tittle = () => {
	return (
		<div className='tittle-box'>
			<h1 className='tittle-text'>Raw IPs for the firewall block lists</h1>
			<h4 className='tittle-text'>curated list by http://rules.emergingthreats.net/fwrules/emerging-Block-IPs.txt</h4>
		</div>
	)
}

export default Tittle;
